var instructions = [
  "",
  "",
  "",
  "",
  "",
]

var keypad = [
  ["1","2","3"],
  ["4","5","6"],
  ["7","8","9"],
]
var curarr = 1; 
var curval = 1;
instructions.forEach(function(value, index, array) {
    for (var i = 0; i < value.length; i++) {
      var next = value[i];
        if(next == "U" && curarr != 0){
          curarr--
        }
        if(next == "D" && curarr != 2){
          curarr++
        }
        if(next == "L" && curval != 0){
          curval--
        }
        if(next == "R" && curval != 2){
          curval++
        }
    }
    console.log(keypad[curarr][curval])
});

